<template>  <H5Layout>    <H5Banner channelCode="xmwh" />    <TabList @activeItem="activeItem" :tabList="tabList" />    <List :activeItem="item" />  </H5Layout></template><script>import TabList from '@/components/TabList.vue'import List from './components/List.vue'import { getChannelSubset } from '@/service/apiList/common'export default {  name: 'pandaCultureList',  components: {    TabList,    List,  },  data() {    return {      tabList: [],      item: {},    }  },  created() {    this.getChannelSubset()  },  methods: {    async getChannelSubset() {      const res = await getChannelSubset({        channelCode: 'xmwh',      })      try {        if (res.code === 0) {          this.tabList = res.data.subset        }      } catch (error) {        return ''      }    },    activeItem(item) {      this.item = item    },  },}</script><style lang="scss" scoped></style>